import * as React from "react";
import {
  StyleSheet,
  Text,
  View,
  Section,
  SectionContent,
  SectionImage,
} from "react-native";
import { Layout, Button } from "react-native-rapi-ui";
import { createStackNavigator } from "@react-navigation/stack";

const Stack = createStackNavigator();
export default function ViewOrdersScreen({ navigation }) {
  return (
    <Layout>
      {/* need to change to image */}
      <SectionImage height="600" source={require("../assets/image.jpg")} />
      <Section>
        <SectionContent>
          <View>
            <Text>
              <Text> Details:</Text>
            </Text>
            <Text>
              {" "}
              <Text>Location:</Text>{" "}
            </Text>
            <Text>
              {" "}
              <Text>Time:</Text>{" "}
            </Text>
            <Text>
              {" "}
              <Text>Available Pax:XXXX</Text>{" "}
            </Text>
          </View>
        </SectionContent>
        <View>
          <View style={styles.button}>
            <Button
              onPress={() => navigation.navigate("AddGroupBuy")}
              text="Edit "
              size="lg"
            />
          </View>
        </View>
      </Section>
      ;
    </Layout>
  );
}
const styles = StyleSheet.create({
  button: {
    padding: 20,
    margin: 10,
  },
});
